const { observable, makeObservable, action } = require('mobx')

class BagState {
    items = []

    constructor() {
        makeObservable(this, {
            items: observable,
            addItem: action,
        })
        this.items = []
    }

    addItem() {
        this.items.push({ name: 'item' })
    }
}

export default new BagState()
